import React from 'react';
import Card from './components/Card';
import './App.scss';


const tariffes = [
  {tariff: "unlim300", tariffName: "Безлимитный 300", price: "300", speed: "10"},
  {tariff: "unlim450", tariffName: "Безлимитный 450", price: "450", speed: "50"},
  {tariff: "unlim500", tariffName: "Безлимитный 500", price: "500", speed: "100", profit: "profit"},
  {tariff: "unlim1000", tariffName: "Безлимитный 1000", price: "1000", speed: "200"}
]


const App = (props) => {

  return (
    <React.Fragment>
        { 
          tariffes.map(tariff => 
            <Card tariff={tariff.tariff} tariffName={tariff.tariffName} price={tariff.price} speed={tariff.speed} profit={tariff.profit} />
          )
        } 
    </React.Fragment>
  );
}

export default App;
